name: Analyse Binary
on:
  workflow_dispatch:
  push:

env:
  binary: MonsterHunterRise40.exe
  url: http://storage.live.com/items/207D308974C1AE6B!220560:/MonsterHunterRise40.exe?authkey=AJkvzg0zYsQ5QxA

jobs:
  analyse:
    name: Analyse Binary
    runs-on: ubuntu-22.04
    steps:
      - name: Update and Upgrade
        run: |
          sudo apt update
          sudo apt upgrade -y
          sudo apt install -y zstd curl wget
      - name: Checkout
        uses: actions/checkout@v3
        with:
          lfs: true

      - name: Download Binary
        run: |
          curl -L ${{ env.url }} -o ${{ env.binary }}
          ls -alh

      - name: start docker and analyse
        run: |
          chmod +x analysis.sh
          ls -alh
          docker run --rm --env BINARY=${{ env.binary }} --name ida-docker -p 8080:8080 -v ${{ github.workspace }}:/root/host nyamisty/docker-wine-ida:7.5sp3 /root/host/analysis.sh

      - name: Print Log
        run: |
          ls -la
          cat ida_log

      - name: Prepare Artifact
        run: |
          tar -cvf - ${{ env.binary }}* ida_log | zstd - -o ${{ env.binary }}.tar.zst

      - name: Artifact
        uses: actions/upload-artifact@v3
        with:
          name: ${{ env.binary }}_0
          path: ${{ env.binary }}.tar.zst

  analyse_continue_1:
    needs: analyse
    name: Analyse Binary Continue 1
    runs-on: ubuntu-22.04
    steps:
      - name: Update and Upgrade
        run: |
          sudo apt update
          sudo apt upgrade -y
          sudo apt install -y zstd

      - name: Checkout
        uses: actions/checkout@v3

      - uses: actions/download-artifact@v3
        with:
          name: ${{ env.binary }}_0

      - name: Prepare_download Artifact
        run: |
          zstd -d ${{ env.binary }}.tar.zst -c | tar xf -

      - name: Check if already completed
        run: |
          if [ "$(cat ida_log | grep "The initial autoanalysis has been finished.")" ]; then
            echo "[+] Already completed! Exit"
            exit 1
          fi

      - name: start docker and analyse
        run: |
          chmod +x analysis.sh
